import React from "react";
import { useNavigate } from "react-router-dom";


const GenreList = () => {
  const navigate = useNavigate();

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div className="genre-list-container">
      <div className="genre-header">
        <h1>Book Library</h1>
        <div className="genre-nav-buttons">
          <button onClick={() => navigate("/")}>Home</button>
          <button onClick={() => navigate("/dash")}>My Books</button>
        </div>
      </div>

      <div className="genre-grid">
        <div className="genre-item" onClick={() => handleNavigate("/sci-fi")}>
          <img src="Images\sct-fi.png" alt="sci-fi"></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/horror")}>
          <img src="Images\horror.png" alt="horror"></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/mystery")}>
          <img src="Images\Mystery.png" alt="mystery"></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/adventure")}>
          <img src="Images\adventure.png" alt="adventure"></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/romance")}>
          <img src="Images\.png" alt=""></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/fantasy")}>
          <img src="Images\fantasy.png" alt=""></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/history")}>
          <img src="Images\.png" alt=""></img>
        </div>
        <div className="genre-item" onClick={() => handleNavigate("/biography")}>
          <img src="Images\.png" alt=""></img>
        </div>
      </div>
    </div>
  );
};

export default GenreList;
